        return "<span style=\"color:".concat(row.colorTextEstado, "\"> ").concat(row.tp_estado, " </span> <br>\n                                                            <span style=\"color:").concat(row.colorObserv, "\"> ").concat(row.tp_observaciones, " </span> <br>\n                                                            <span style=\"color:").concat(row.colorUserEstado, "\"> (").concat(row.tp_usuario, ") </span> <br>\n                                                            <span style=\"color:").concat(row.colorTextEstado, "\"> ").concat(row.tp_fechahora, " </span>");
